const MainTabItems = [
  {
    className : "nav-link active",
    url : '../Search/flight.js',
    title : "Flights",
    toggle : "tab"
  },
  {
    className : "nav-link",
    url : '../Search/hotel.js',
    title : "Hotels",
    toggle : "tab"
  },
  {
    className : "nav-link",
    url : '../Search/car.js',
    title : "Car Rentals",
    toggle : "tab"
  }
]

export default MainTabItems;
